    public String indentar(String str){
        
        String[] stringArray = str.split("\n");
        
        String resultado = "";
        for(int i = 0; i<stringArray.length;i++){
            resultado += indentation(tab_n) + stringArray[i] + "\n";
        }
        return resultado;

        //System.out.println(resultado);
    }
